import { ImgurClient } from 'imgur';

// CommonJS syntax
export const ImageUpload = async()=>{
    const client = new ImgurClient({ accessToken: "ad43bca8e978a396cdc4da98604e53c821fc9a1b" });

    await client.upload('../assets/img/qr_logo.png');
}
